import React from "react";

import './main-content.css';

const MainContent = () => {
    return (
        <div className='main-content'>
            <div className="main-content__container">
                <div className="first-section">
                    <h1 className='first-section__title'>Остеопороз</h1>
                    <p className='first-section__text'>С остеопорозом сталкиваются практически все врачи, работающие с пациентами старших возрастных групп. Особенно часто это заболевание встречается у женщин в периоде постменопаузы.</p>
                </div>

                <div className="second-section">
                    <p className='second-section__title'>1. Опасность остеопороза</p>
                    <p className='second-section__text'>С остеопорозом сталкиваются практически все врачи, работающие с пациентами старших возрастных групп. Особенно часто это заболевание встречается у женщин в периоде постменопаузы.</p>
                </div>
            </div>
        </div>
    )
};

export default MainContent;
